INSERT INTO `notice` VALUES ('1543429357333118976', '<span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">如果你指定了一个默认变量，那你现在可以在枚举上使用</span><code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">#[derive(Default)]</code><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">。例如，到目前为止，你必须手动为此枚举编写一个&nbsp;</span><code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">Default</code><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">impl：</span><div><p style=\"margin-bottom: 20px; line-height: inherit; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">以前，<code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">Mutex</code>、<code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">Condvar</code>&nbsp;和&nbsp;<code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">RwLock</code>&nbsp;由 Linux 上的 pthreads 库支持。pthreads 锁支持比 Rust API 本身更多的功能，包括运行时配置，并且被设计用于比 Rust 提供的&nbsp;</span><span style=\"color: rgb(0, 0, 0);\">static guarantees&nbsp;</span><span style=\"color: rgb(0, 0, 0);\">更少的语言中。</span><span style=\"color: rgb(0, 0, 0);\">例如，mutex 的实现是 40 字节，不能移动。这迫使标准库在幕后为使用 pthreads 的平台的每个新的 mutex 分配一个 Box。</span></p><p style=\"margin-bottom: 20px; line-height: inherit; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">公告指出，Rust 的标准库现在在 Linux 上提供了这些锁的基于 futex 的原始实现，它非常轻量级并且不需要额外的分配。在 1.62.0 中，<code style=\"font-family: Consolas, Monaco, &quot;Andale Mono&quot;, &quot;Ubuntu Mono&quot;, monospace; font-size: 13px; margin: 0px 3px; padding: 3px 4px; border: none; border-radius: 4px; background: rgb(246, 246, 246); color: rgb(51, 51, 51);\">Mutex</code>&nbsp;在 Linux 上的内部状态只需要 5 个字节，尽管这在未来的版本中可能会改变。</span></p><p style=\"margin-bottom: 20px; line-height: inherit; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">这是提高 Rust 的 lock types 效率的长期努力的一部分，其中包括以前对 Windows 的改进，例如&nbsp;</span><span style=\"color: rgb(0, 0, 0);\">unboxing&nbsp;</span><span style=\"color: rgb(0, 0, 0);\">其</span><span style=\"color: rgb(0, 0, 0);\">&nbsp;primitives</span><span style=\"color: rgb(0, 0, 0);\">。<a href=\"https://www.oschina.net/action/GoToLink?url=https%3A%2F%2Fgithub.com%2Frust-lang%2Frust%2Fissues%2F93740\" target=\"_blank\" style=\"background-color: transparent; color: rgb(52, 111, 182); text-decoration-line: none;\">可以在</a>&nbsp;</span><a href=\"https://www.oschina.net/action/GoToLink?url=https%3A%2F%2Fgithub.com%2Frust-lang%2Frust%2Fissues%2F93740\" target=\"_blank\" style=\"background-color: transparent; color: rgb(52, 111, 182); text-decoration-line: none;\">tracking issue</a>&nbsp;<span style=\"color: rgb(0, 0, 0);\">中阅读有关该工作的更多信息。</span></p></div>', b'1', '2022-07-22 12:26:03', '2022-07-03 11:00:00', 'Rust 1.62.0 稳定版发布', 3, '2022-07-21 23:19:26', '3'), ('1547956948169654272', '发动机狂热尽快解放军的咖啡店男人狂热i肌肤的肌肤', b'1', '2022-07-22 12:15:16', '2022-07-15 22:51:00', '测试把', 4, '2022-07-21 23:19:20', '4'), ('1550138573187973120', '热裤积分扩大进口人家儿科JFK的接口健康热熔而艰苦奋斗精神垃圾垃圾发动机空间仍可见认可就', b'1', '2022-07-22 12:25:59', '2022-07-21 23:20:00', '测试', 2, '2022-07-22 00:04:27', '1'), ('1550139099694759936', '热裤积分扩大进口', b'1', '2022-07-21 23:34:50', '2022-07-21 23:22:16', '打断电', 1, '2022-07-21 23:19:20', '3'), ('1550139405895729152', '88888888888888888', b'1', '2022-07-22 12:26:01', '2022-07-21 18:00:00', '啊哈哈哈', 1, '2022-07-21 23:23:29', '3'), ('1550139714911076352', '2222', b'1', '2022-07-22 12:15:18', '2022-07-21 13:00:00', '111', 1, '2022-07-21 23:24:43', '3'), ('1550336916002439168', '<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: black;\">亲爱的iBox用户：</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: black;\">       您好！</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       iBox链盒</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">「创艺之境」</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">所属藏品</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">《花木兰从军》，</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">于</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">2022年7月21日</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">在iBox平台正式发行。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: black;\">       </strong><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">发行计划：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">2000份</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: black;\">       </strong><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">发行单价：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">299元</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: black;\">       </strong><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">藏品名称：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">花木兰从军</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">       <strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">创作者介绍：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(31, 35, 41);\"> </span>张松茂</p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">       1934年出生，江西鄱阳人，是我国陶瓷美术界的全能画师。擅长人物、山水、花鸟等以中国画为主的陶瓷彩绘艺术，功底深厚，成就极大。</p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">       其传略被记入《中国当代要艺家传》，并于1994年享受国务院颁发的政府特殊津贴，先后荣获“陶瓷美术家”、“高级工艺美术师”、\"中国工艺美术大师\"、\"中国工艺美术终身成就奖”、\"亚太地区手工艺大师”等称号，现系中国美术家协会会员、中国陶瓷美术学会理事、景德镇市文学艺术界联合会副主席、江西省第七届政协委员。</p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">       其代表作《井冈春色》大型陶瓷壁画，陈列于北京人民大会堂江西厅，《紫归牡怀图》作为江西省政府赠送香港特别行政区成立的珍贵礼品，《三顾茅庐》被中国工艺美术馆作为国家工艺珍品收藏，第二块《三顾茅庐》在北京交付，最终以1300万元人民币成交，开创了中国当代单件艺术陶瓷千万元的新时代。</p>', b'0', NULL, '2022-07-22 12:27:00', '「创艺之境」所属藏品《花木兰从军》今日上线', 0, '2022-07-22 12:28:19', '1'), ('1550337086916132864', '<p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">亲爱的iBox用户：</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       您好！</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: black;\">       iBox链盒</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">「创艺之境」</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">所属藏品</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">《花木兰从军》</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: black;\">将于</span><strong style=\"box-sizing: 