ounter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">        空投用户白名单公示链接：</strong></p><p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">        <a href=\"https://docs.qq.com/sheet/DVW5LU3NzZ29aZ2Jr\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"box-sizing: border-box; cursor: pointer; outline: none; text-decoration-line: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 102, 204);\">https://docs.qq.com/sheet/DVW5LU3NzZ29aZ2Jr</a></p><p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"> </strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">        敬请各位用户知悉，谢谢！</span></p>', b'0', NULL, '2022-07-20 10:30:00', '『Nonoku在⼈间』系列作品《是谁喝了Nonoku的可乐》空投白名单', 0, '2022-07-22 12:30:26', '3'), ('1550337624479105024', '<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">亲爱的iBox用户：</strong></p><p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       您好！</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       “一曲大合唱，可顶十万毛瑟枪！”作为中华民族新音乐事业的先锋，冼星海在其短暂而又辉煌的一生中，谱写了大量展现民族苦难、反映革命精神的恢弘音乐篇章。无论是如今早已家喻户晓的《黄河大合唱》，还是抗日救亡运动中即兴创作的《救国军歌》，无一不体现了革命时期中国人民面对强敌的不屈与顽强！</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       从音乐家到革命家，冼星海穷其一生，矢志不渝、赤忱报国。为了纪念这位为民族复兴奉献毕生激情的无产阶级革命家，iBox链盒与宁波市演艺集团合作，从原创当代舞剧《冼星海》中选取了两个经典片段，依托数字化区块链技术为线下舞剧赋能，于近日推出了两款数字藏品——《洪流》与《故土》。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       同时，宁波市演艺集团提供</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">2022年7月26日-- 2023年7月25日</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">期间</span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">舞剧《冼星海》线下门票总计100张</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">（其中第一类门票30张，第二类门票30张，第三类门票40张），供数字藏品《洪流》与《故土》持有者抽奖使用，即持有《洪流》与《故土》数字藏品的用户有几率抽取到舞剧《冼星海》线下门票。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><br style=\"box-sizing: border-box;\"></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       </span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">其中「音乐·影视」板块「舞台剧」系列数字藏品《洪流》已于2022年7月20日在iBox平台正式发行，现将藏品《洪流》抽奖活动进行公布</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">（藏品《故土》抽奖活动待上线之后另行公布）：</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><br style=\"box-sizing: border-box;\"></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">      &nbsp;抽奖资格：持有权益藏品《洪流》的用户</strong></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(230, 0, 0);\">       注：</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(230, 0, 0);\">       1、 在抽奖时间内，用户持有1份《洪流》可抽奖1次。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(230, 0, 0);\">       2、抽中舞剧《冼星海》线下门票的用户，待后续客服联络登记场次及门票发放。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(230, 0, 0);\">       3、演出实体门票有效时间：2022年7月26日-- 2023年7月25日；用户可在此有效时间段内根据剧院场次安排自主选择兑换、观演。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(230, 0, 0);\">       4、例如：用户A抽奖开始时持有2份《洪流》，用户A抽奖2次；用户A可通过市场购买藏品《洪流》增加抽奖次数，但请用户注意，本次抽奖会随奖品全部被抽中实时停止。</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><br style=\"box-sizing: border-box;\"></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       奖品：</strong></p><ol style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">一等奖300名：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">藏品优先购机会1次</span></li><li style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">二等奖15名：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">舞剧《冼星海》线下第一类门票1张</span></li><li class=\"ql-align-justify\" style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1; text-align: justify;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">三等奖15名：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">舞剧《冼星海》线下第二类门票1张</span></li><li class=\"ql-align-justify\" style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1; text-align: justify;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">四等奖20名：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0);\">舞剧《冼星海》线下第三类门票1张</span></li></ol><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><br style=\"box-sizing: border-box;\"></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><strong style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">       </strong><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0); background-color: rgb(255, 153, 0);\">抽奖时间：</strong><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(0, 0, 0); background-color: rgb(255, 153, 0);\">2022年7月21日21:00--24:00</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">    （温馨提示：本次抽奖会随奖品全部被抽中实时停止）</span></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><br style=\"box-sizing: border-box;\"></p><p class=\"ql-align-justify\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 0px; padding: 0px; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; text-align: justify; line-height: 1.5em; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">      </span><span style=\"box-sizing: border-box; margin-top: 10px; color: rgb(230, 0, 0);\"> </span><strong style=\"box-sizing: border-box; margin-top: 10px; color: rgb(230, 0, 0);\">提示：</strong></p><ol style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; cursor: text; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; white-space: break-spaces; color: rgb(44, 44, 52); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\"><li class=\"ql-align-justify\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">门票可以于年度巡演的任意一场进行兑换。</span></li><li style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px 0px 0px 1.5em; list-style: none; counter-rese