-- ----------------------------
-- View structure for v_everyday_trade_data
-- ----------------------------
DROP VIEW IF EXISTS `v_everyday_trade_data`;
CREATE VIEW `v_everyday_trade_data` AS select concat(convert(`a`.`everyday` using utf8),`a`.`biz_mode`) AS `id`,str_to_date(`a`.`everyday`,'%Y-%m-%d %H:%i:%s') AS `everyday`,`a`.`biz_mode` AS `biz_mode`,`a`.`success_amount` AS `success_amount`,`a`.`success_count` AS `success_count` from (select date_format(`nft`.`pay_order`.`create_time`,'%Y-%m-%d') AS `everyday`,`nft`.`pay_order`.`biz_mode` AS `biz_mode`,round(sum((case when (`nft`.`pay_order`.`state` = '2') then `nft`.`pay_order`.`amount` else 0 end)),2) AS `success_amount`,sum((case when (`nft`.`pay_order`.`state` = '2') then 1 else 0 end)) AS `success_count` from `nft`.`pay_order` group by `nft`.`pay_order`.`biz_mode`,date_format(`nft`.`pay_order`.`create_time`,'%Y-%m-%d')) `a`;

-- ----------------------------
-- View structure for v_exchange_code_summary
-- ----------------------------
DROP VIEW IF EXISTS `v_exchange_code_summary`;
CREATE VIEW `v_exchange_code_summary` AS select `e`.`collection_id` AS `id`,count(1) AS `total_count`,sum((case when (`e`.`state` = '1') then 1 else 0 end)) AS `unused_count`,sum((case when (`e`.`state` = '2') then 1 else 0 end)) AS `used_count`,sum((case when (`e`.`state` = '3') then 1 else 0 end)) AS `invalid_count`,sum((case when (`e`.`state` = '4') then 1 else 0 end)) AS `expired_count`,max(`e`.`create_time`) AS `last_generate_time` from `exchange_code` `e` where (`e`.`deleted_flag` = 0) group by `e`.`collection_id`;

-- ----------------------------
-- View structure for v_member_hold_artwork_summary
-- ----------------------------
DROP VIEW IF EXISTS `v_member_hold_artwork_summary`;
CREATE VIEW `v_member_hold_artwork_summary` AS select concat(`m`.`member_id`,`m`.`collection_id`) AS `id`,`m`.`member_id` AS `member_id`,`m`.`collection_id` AS `collection_id`,count(1) AS `artwork_count` from `member_hold_collection` `m` where (`m`.`state` in ('1','3')) group by `m`.`member_id`,`m`.`collection_id`;

-- ----------------------------
-- View structure for v_member_invited_count
-- ----------------------------
DROP VIEW IF EXISTS `v_member_invited_count`;
CREATE VIEW `v_member_invited_count` AS select `t1`.`id` AS `id`,count(1) AS `total_count`,sum((case when (`t2`.`bind_real_name_time` is not null) then 1 else 0 end)) AS `real_name_count`,sum((case when (`t2`.`bought_flag` = '1') then 1 else 0 end)) AS `bought_count` from (`member` `t1` left join `member` `t2` on((`t1`.`id` = `t2`.`inviter_id`))) where ((`t2`.`deleted_flag` = 0) and (`t2`.`inviter_id` is not null)) group by `t1`.`id`;

-- ----------------------------
-- View structure for v_member_paid_summary
-- ----------------------------
DROP VIEW IF EXISTS `v_member_paid_summary`;
CREATE VIEW `v_member_paid_summary` AS select `p`.`member_id` AS `id`,count(1) AS `paid_count`,sum(`p`.`amount`) AS `paid_amount`,min(`p`.`paid_time`) AS `first_paid_time`,max(`p`.`paid_time`) AS `lately_paid_time` from `pay_order` `p` where (`p`.`state` = '2') group by `p`.`member_id`;

SET FOREIGN_KEY_CHECKS = 1;
